pub enum Error {

    /// The buffer is too small.
    BufferTooSmall,

    /// The device is not ready.
    NotReady,

    /// The queue is already in use.
    AlreadyUsed,

    /// Invalid parameter.
    InvalidParam,

    /// Failed to alloc DMA memory.
    DmaError,

    /// I/O Error
    IoError,
}
